import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

// Simple components for testing
const SimpleNavbar = () => (
  <nav className="navbar navbar-expand-lg navbar-dark bg-primary">
    <div className="container">
      <span className="navbar-brand">Student Feedback System</span>
      <div className="navbar-nav">
        <a className="nav-link" href="/">Courses</a>
        <a className="nav-link" href="/feedback">Feedback</a>
        <a className="nav-link" href="/analytics">Analytics</a>
        <a className="nav-link" href="/manage-courses">Manage Courses</a>
      </div>
    </div>
  </nav>
);

const HomePage = () => <div><h2>Courses will be listed here</h2></div>;
const FeedbackPage = () => <div><h2>Feedback form will be here</h2></div>;
const AnalyticsPage = () => <div><h2>Analytics will be here</h2></div>;
const ManagementPage = () => <div><h2>Course management will be here</h2></div>;

function App() {
  return (
    <Router>
      <div className="App">
        <SimpleNavbar />
        <div className="container mt-4">
          <Routes>
            <Route path="/" element={<HomePage />} />
            <Route path="/feedback" element={<FeedbackPage />} />
            <Route path="/analytics" element={<AnalyticsPage />} />
            <Route path="/manage-courses" element={<ManagementPage />} />
          </Routes>
        </div>
      </div>
    </Router>
  );
}

export default App;
